import React from 'react';
import { Link } from 'react-router-dom';
import Card from '../Card';
import './Cards.css';

const Cards = ({ cards }) => (
  <ul id="centerDiv">
    {
      cards.map((card) => (
        <li class="centerUL" key={card}>
          {/* <Link to={ `/cards/${shared.constants.urlEscape[card] || card}` } title={ `Card ${card}` }>
            <Card card={ card } />
          </Link> */}
          <Card card={card} />
        </li>
      ))
    }
  </ul>
);

export default Cards;
